											<div className="btn btn-primary" onClick={this.showLastTweentyButtons.bind(this)} title="Fast Forward"><i className="fa fa-fast-forward"></i></div>
										}
									</div>							
								</div>
								:
								null
							:
							null
	                    }

	                </div>                        
	            </div>
            </div>
	    );

	} 

}

export default withRouter(IAssureTable);
